<span class="line"><span style="color:#FFCB6B;">tail</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">-f</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">mail.log</span><span style="color:#EEFFFF;"> </span><span style="color:#545454;font-style:italic;"># 等同于--follow=descriptor，根据文件描述符进行追踪，当文件改名或被删除，追踪停止</span></span>
